      }
      Main.itemLockoutTime[index1] = 0;
      Main.item[index1] = new Item();
      Main.item[index1].SetDefaults(Type, false);
      Main.item[index1].Prefix(pfix);
      Main.item[index1].position.X = (__Null) (double) (X + Width / 2 - Main.item[index1].width / 2);
