    }

    public void OnPurchase(Item item)
    {
      if (!item.shopCustomPrice.HasValue)
        return;
      item.shopSpecialCurrency = -1;
      item.shopCustomPrice = new int?();
    }

    public int GetStoreValue()
    {
      if (this.shopCustomPrice.HasValue)
